if you're looking for a nice game, you're in the right place. Wobbly life basically has two sides,
one where you wobble around with your friends, have some fun, farm some money, show off your cars and your progress, and the other where you get severe anger issues because your dumb friend flew into a tree and the artifact flies away, never to be seen again, or you fish the same fish over and over again. But still a highly recommendable game!
Recommended it to almost all of my friends and everyone loved it (except the two guys with the potato graphics card)
